# Django IAM database backends


## Usage

```shell
pip install django-rds-iam-auth
```

In your settings use the following

```python
DATABASES = {
    "default": {
        "HOST": "<hostname>",
        "USER": "<user>",
        "ENGINE": 'django_rds_iam_auth.aws.postgresql'
        "OPTIONS": {
            "use_iam_auth": True
        }
    }
}
```
